import React from 'react'
import Home from './Componentes/Home/Home'
import Producto from './Componentes/Producto/Producto';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  link

} from "react-router-dom";

const App =()=> {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/Home">
           <Home />
          </Route>
          <Route path="/users">
          </Route>
          <Route path="/Productos">
            <Producto />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
